import React from 'react'

const NavigationLogo = (props) =>{
    return(
        <div className="flex items-end">
            <img src={props.logo} alt = 'noodles' className = 'nav-logo-image h-12 w-12 pr-2'/>
            <div className = 'nav-logo-text text-white pl-2'>
                Pasterino
            </div>
        </div>
    );
}

export default NavigationLogo;
